
import pandas as pd #潛規則
from sklearn.datasets import load_iris
iris = load_iris()
df = pd.DataFrame(iris["data"],
            columns=iris["feature_names"])
df["ans"] = iris["target"]
df.to_csv("iris.csv", encoding="utf-8", index=False)
df #比較漂亮格式印出來 jupinotebook常用，要寫在最後一行

"""開始丟到sklearn前,把所有東西轉換成numpy array"""

import numpy as np
from sklearn.model_selection import train_test_split
# x:輸入 , y:輸出
y = df["ans"]
y = np.array(y)
x = df.drop(["ans"], axis=1) # drop丟掉[ans]這個資料 [axis=1]行 #沒填axis=1，axis預設為0(列)
x = np.array(x)
x_train, x_test, y_train, y_test = train_test_split(x, y, test_size=0.1)

from sklearn.tree import DecisionTreeClassifier  #分類函數
clf = DecisionTreeClassifier() #建分類器
clf.fit(x_train, y_train) #用分類器訓練x,y

from sklearn.tree import DecisionTreeClassifier  #分類函數
clf = DecisionTreeClassifier(max_depth=2) #建分類器 ，用max_depth剪枝，剪到往下篩兩層
clf.fit(x_train, y_train) #用分類器訓練x,y

from sklearn.tree import plot_tree
plot_tree(clf)

"""![1635825941541.jpg](data:image/jpeg;base64,)


一開始sample會依設定比例(例如9:1)隨機切分訓練/測試資料，訓練器會在訓練資料內挑出最適當的切分條件做出決策樹(Dicision Tree)，主要是依該組訓練資料最低的gini(猜錯率)來切割，以提升決策樹整體信心率。

此圖 petal length (cm) <== 2.45 是挑出的第一個切點，挑這個切點是因為判斷這樣切是整組gini最低的一個點。
"""

import matplotlib.pyplot as plt
from sklearn.tree import plot_tree
plt.figure(figsize=(10, 10))
plot_tree(clf, 
          feature_names=iris["feature_names"], #秀出切分點名字
          class_names=iris["target_names"],  #最多的是哪一類
          filled=True) #上色， 依最多分類顏色

from sklearn.metrics import accuracy_score
pre = clf.predict(x_test)  #預測結果(預測值)，算出模型引數構成的模型，對解釋變數進行預測獲得其結果，用训练器数据X拟合分类器模型并对训练器数据X进行预测
accuracy_score(pre, y_test) #驗證正確率